import React from "react";
import "../css/Profile.css"
function Profile(){
    return(
        <div>
            <h4>Hello User</h4>
            <p>To access your Meesho account</p>
            <button>Sign Up</button>
            <div></div>
            <h4>My Orders</h4>

        </div>

    );
}
export default Profile;
